import React, { useState } from 'react';
import { Link } from 'react-router-dom'; 
import Complaint from "../user_component/complaint";// Make sure to import Link from react-router-dom
import './UserNavbar.css'; // You should have a CSS file to style the sidebar

function Usernavbar() {
    const [isSidebarOpen, setIsSidebarOpen] = useState(false);

    const toggleSidebar = () => {
        setIsSidebarOpen(!isSidebarOpen);
    };

    return (
        <div className={`sidebar ${isSidebarOpen ? 'open' : ''}`}>
            <div className="hamburger" onClick={toggleSidebar}>
                <div className={`bar ${isSidebarOpen ? 'open' : ''}`}></div>
                <div className={`bar ${isSidebarOpen ? 'open' : ''}`}></div>
                <div className={`bar ${isSidebarOpen ? 'open' : ''}`}></div>
            </div>
            <h2 className='welcomeAdmin'>Welcome User</h2>
            <Complaint />
            <div className="logout-btn-div">
                <Link to='/'>
                    <button className='logOut'>Logout <i className="logout fa-solid fa-arrow-right-from-bracket"></i></button>
                </Link>
            </div>
        </div>
    );
}

export default Usernavbar;
